class MapHolder extends Component {

    constructor(props) {
        super(props);
       // this.state = {};
        this.debounce  = _.debounce(e => e(), 300);
    }



    render() {

        //console.log(this.state.viewState);

        let that = this;

        class Controller extends MapController {
            handleEvent(event) {

                super.handleEvent(event);

                if ((event.type === 'panend' || event.type === 'wheel' )) {
                    let chapter = that.props.chapter;

                    that.debounce(() => that.props.updateSlideCamera({variables : {chapter_id : chapter.id, camera : this.controllerState._viewportProps}}));

                }
            }
        }


        let controller = Controller;

        const mvtLayer = new MVTLayer({
            data: `https://a.tiles.mapbox.com/v4/mapbox.mapbox-streets-v7/{z}/{x}/{y}.vector.pbf?access_token=pk.eyJ1IjoibW9nbW9nIiwiYSI6ImNpZmI2eTZuZTAwNjJ0Y2x4a2g4cDIzZTcifQ.qlITXIamvfVj-NCTtAGylw`,


            renderSubLayers: (props) => {

                return [
                    new GeoJsonLayer({
                        ...props,
                        data : props.data.filter(d => d.geometry.type === 'LineString'),
                        id: `${props.id}_point`,
                        visible: true,
                        getLineColor: [255, 127, 0, 100],
                        lineWidthScale: 10,
                        lineWidthMinPixels: 4,
                        getRadius: 5,
                        getLineWidth: 1,
                        _subLayerProps: {
                            "line-strings": {type: CustomPathLayer},
                        }
                    })
                ]
            }
        });

        const layer = new GeoJsonLayer({
            id: 'geojson-layer',
            data : x,
            pickable: true,
            stroked: false,
            getElevation : 1,
            lineWidthScale: 20,
            lineWidthMinPixels: 14,
            getLineColor: [128,128,128],//[255, 238,0, 255],
            getRadius: 100,
            getLineWidth: 1,

            _subLayerProps: {
                "line-strings": {type: CustomPathLayer},
            }

        })

        const photos = new AssetLayer({data : _(this.props.chapter.assets)});

        return (
            <div className={'Holder'}>

                <DeckGL
                    //effects={[]}
                    controller={controller}
                    height="100%"
                    width="100%"
                    pickingRadius={ 10 }
                    layers={[  mvtLayer, layer, photos ] }
                    viewState={this.props.viewState}
                    onViewStateChange={({viewId, viewState}) => {
                        this.props.setViewState(viewState);
                    }
                    }
                    //onViewStateChange={({ viewState }) => { this.props.setViewState({viewState})}}
                    ref={deck => {
                        this.deckGL = deck;
                    }}
                >

                </DeckGL>

            </div>
        );
    }
}

export default MapHolder;
